module.exports = "<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n  <meta charset=\"utf-8\">\r\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1, shrink-to-fit=no\">\r\n  <meta name=\"description\" content=\"I-Talent portfolio\">\r\n  <meta name=\"author\" content=\"Wouter Vanherck\">\r\n\r\n  <title>{{title}}</title>\r\n\r\n</head>\r\n\r\n<body id=\"page-top\">\r\n\r\n  <!-- Navigation -->\r\n  <app-navbar></app-navbar>\r\n\r\n  <!-- Header with picture -->\r\n  <app-header></app-header>\r\n\r\n  <!-- Header with introduction -->\r\n  <app-introduction></app-introduction>\r\n\r\n  <!-- Overview -->\r\n  <app-overview></app-overview>\r\n\r\n  <!-- Timeline -->\r\n  <app-timeline></app-timeline>\r\n\r\n  <!-- Portfolio Grid -->\r\n  <app-grid></app-grid>\r\n\r\n  <!-- Reflection -->\r\n  <app-reflection></app-reflection>\r\n\r\n  <!-- Contact -->\r\n  <app-contact></app-contact>\r\n\r\n  <!-- Footer -->\r\n  <app-footer></app-footer>\r\n\r\n  <!-- Portfolio Modals -->\r\n  <!-- Modal 1 -->\r\n  <div class=\"portfolio-modal modal fade\" id=\"portfolioModal1\" tabindex=\"-1\" role=\"dialog\" aria-hidden=\"true\">\r\n    <div class=\"modal-dialog\">\r\n      <div class=\"modal-content\">\r\n        <div class=\"close-modal\" data-dismiss=\"modal\">\r\n          <div class=\"lr\">\r\n            <div class=\"rl\"></div>\r\n          </div>\r\n        </div>\r\n        <div class=\"container\">\r\n          <div class=\"row\">\r\n            <div class=\"col-lg-8 mx-auto\">\r\n              <div class=\"modal-body\">\r\n                <!-- Project Details -->\r\n                <h2>Studiereis Linz</h2>\r\n                <p class=\"item-intro text-muted\">Internationalisering</p>\r\n                <img class=\"img-fluid d-block mx-auto\" src=\"assets/img/LINZ.png\" alt=\"\">\r\n                <h3>Omschrijving</h3>\r\n                <p>De hogeschool PXL gaf ons de kans om op studiereis te gaan in Linz en bood hierbij verschillende activiteiten\r\n                  aan zoals het bezoeken van universiteiten, bedrijven en museums of andere interessante trekpleisters.</p>\r\n                <h3>Kern</h3>\r\n                <p>Woensdag 15 maart was het zover, na een busrit 10 uur kwamen we aan in het\r\n                  <a href=\"http://www.sommerhaus-hotel.at/en/linz\">Sommerhaus hotel te Linz</a>. Een gezellige plaats omringd met studenten gebouwen en bijbehorende eetmogelijkheden.\r\n                  Omdat we pas om 8u ‘s avonds zijn aangekomen waren er die dag nog geen activiteiten gepland en hadden we\r\n                  de tijd om uit te pakken en wat te verkennen.\r\n                </p>\r\n                <p>De volgende dag vertrokken we meteen naar de campus van de\r\n                  <a href=\"https://www.fh-ooe.at/\">University of Applied Sciences of Upper Austria</a>\r\n                  (FH-OO: Fachhochschule Ober Österreich), waar we een presentatie omtrent internationale programma’s en een rondleiding kregen.\r\n                  Namiddag was een bedrijfsbezoek aan\r\n                  <a href=\"http://www.voestalpine.com/stahlwelt/en\">Voest Alpine</a> gepland. Zij speelden een belangrijke rol in de tweede oorlog en produceren tot vandaag\r\n                  nog steeds metaal. Hier kregen we eerst een uitgebreide rondleiding waar er tal van informatieve en interactieve\r\n                  bezigheden waren, waarna we met de bus verder door de rest van de fabriek gingen. We sloten de avond af\r\n                  met een typisch Oostenrijks avondmaal in het restaurant Alte Welt en wat vrije tijd in de stad.\r\n                </p>\r\n                <img class=\"img-fluid d-block mx-auto\" src=\"assets/img/portfolio/portfolio-linz/L_G2.png\" alt=\"\">\r\n                <p>Op de tweede volledige dag, die ik persoonlijk het interessantste vond, bestond onze voormiddag activiteit\r\n                  met het bezoek aan het\r\n                  <a href=\"https://www.aec.at/\">Ars Electronica Center</a>. Deze plaats kun je vergelijken met een interactieve versie van een modern museum,\r\n                  of zoals we in België kennen, de Technopolis. De onderwerpen hierbinnen zijn vooral gefocust op technologieën\r\n                  in de medische- en agrarische sector of onderwerpen als robotics maar variëren ook van mode tot design\r\n                  zoals 3D prints. Zolang er maar elektronica bij komt kijken kan je het hier vinden.’s Middags werden we\r\n                  dan weer verwacht aan de universiteit waar een speciaal evenement aan de gang was. Het was namelijk zo\r\n                  dat de lokale studenten hun projecten voorstelde. Deze waren heel variërend en vaak ook interactief of\r\n                  zo aantrekkelijk mogelijk gemaakt. De tijd gespendeerd vloog hierdoor voorbij en de dag kwam op zijn einde.\r\n                </p>\r\n                <p>De laatste volledige dag was het bezoek aan Wenen, een grote stad vol met indrukwekkende oude gebouwen en\r\n                  monumenten. Hier werd de bijna volledige voormiddag gevuld met stadsbezoek waar de leerkrachten als gids\r\n                  handelden en werden we vanaf de middag de wereld ingestuurd. Na wat verkennen en het genieten van plaatselijke\r\n                  keuken hadden we als kleiner groepje besloten om het\r\n                  <a href=\"https://www.khm.at/en\">kunsthistorisch museum</a> te bezoeken. Dit museum is één van de bekendere museums en neemt een immense\r\n                  oppervlakte in beslag. Het is namelijk zo dat ik 3 uur besteed heb en ik niet verder ben geraakt dan de\r\n                  eerste verdieping, dus als je alles gezien zou willen hebben moet je zeker op een dag tellen. Mijn favoriete\r\n                  periode binnen de context van het museum was de Aziatische cultuur en de Ming-dynastie, maar er waren veel\r\n                  meer artefacten uit de griekse of romeinse tijd met zijn opvolgende katholieke cultuur. Toen onze tijd\r\n                  in het museum om was, kwamen we met ons groepje weer samen en zijn we gaan poolen tot we weer de bus naar\r\n                  Linz namen, waar we de dag afgesloten hebben met een lekker avondmaal.\r\n                </p>\r\n                <p>Wat avondspelletjes en een laatste nachtrust brachten me tot de dag om weer te vertrekken. Klaar om de 10\r\n                  uur busrit weer aan te gaan en thuis nog wat uit te rusten, iets wat ik zeker kon gebruiken na zo’n volgeplande\r\n                  reis.\r\n                </p>\r\n\r\n                <!-- Carousel -->\r\n                <app-carousel></app-carousel>\r\n\r\n                <h3>Reflectie</h3>\r\n                <p>De reis van begin tot einde was een hele ervaring. Wat een leuke uitstap was met vrienden en junior-collega's\r\n                  was zeer rijk aan cultuur maar had tegelijk ook voldoende informatie in het kader van IT. Zo kregen we\r\n                  de eerste dag een infomoment met het schoolbestuur van de plaatselijke universiteit en werd er uitgelegd\r\n                  hoe er aan verder- of internationaal studeren werd gedaan. Dit liet ons, omdat we toch al in onze jaar\r\n                  zitten, nadenken over wat we precies willen doen en hoe we verder gaan. Daarnaast vond ik dat het bezoek\r\n                  aan Voest Alpine ons de andere kant van het verhaal en dat er een tweede beeld geschetst werd. Dat beeld\r\n                  verduidelijkte dat een job in de IT niet altijd wil betekenen dat je elke dag 8 uur moet programmeren.\r\n                  Het werd al snel duidelijk dat er voor ons nog veel opties beschikbaar zijn.</p>\r\n                <p>Het bezoek aan het Ars Electronica Center vond ik ook een grote meerwaarde hebben. De projecten en producten\r\n                  die daar tentoongesteld worden laten je verder denken over je mogelijkheden, in de vorm van projecten,\r\n                  en andere creatieve ideeën die je zelf zou willen uitvoeren. De gelukkigen onder ons kwamen hier ook in\r\n                  aanraking met onderwerpen waar ze nog niet bij stilgestaan hadden en mogelijke interesses die zij ook kunnen\r\n                  doortrekken in een job. Onderwerpen als robotics en databeheer zijn hiervoor zeker geen uitzondering. Al\r\n                  moet ik zeggen dat het ontwerpen van 3D-relatieve architectuur, om deze later uit te printen, mij het meeste\r\n                  aantrok.\r\n                </p>\r\n                <p>Als slot wil ik de reis zelf als een geheel beoordelen, waar ik in het algemeen zeer tevreden over ben. De\r\n                  ervaring en zelfstandigheid wat dit met zich meebracht verwelkom ik graag in mijn persoonlijke bundel wat\r\n                  mij maakt tot wie ik ben.</p>\r\n                <img class=\"img-fluid d-block mx-auto\" src=\"assets/img/portfolio/portfolio-linz/L_G1.png\" alt=\"\">\r\n                <ul class=\"list-inline\">\r\n                  <li>15 - 19 Maart 2017</li>\r\n                </ul>\r\n                <button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">\r\n                  <i class=\"fa fa-times\"></i>\r\n                  Sluit</button>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n\r\n  <!-- Modal 2 -->\r\n  <div class=\"portfolio-modal modal fade\" id=\"portfolioModal2\" tabindex=\"-1\" role=\"dialog\" aria-hidden=\"true\">\r\n    <div class=\"modal-dialog\">\r\n      <div class=\"modal-content\">\r\n        <div class=\"close-modal\" data-dismiss=\"modal\">\r\n          <div class=\"lr\">\r\n            <div class=\"rl\"></div>\r\n          </div>\r\n        </div>\r\n        <div class=\"container\">\r\n          <div class=\"row\">\r\n            <div class=\"col-lg-8 mx-auto\">\r\n              <div class=\"modal-body\">\r\n                <!-- Project Details -->\r\n                <h2>Angular</h2>\r\n                <p class=\"item-intro text-muted\">Seminaries - Innovatie - Student Engagement - Persoonlijke Ontwikkeling</p>\r\n                <img class=\"img-fluid d-block mx-auto\" src=\"assets/img/ANG.png\" alt=\"\">\r\n                <h3>Omschrijving</h3>\r\n                <p>Angular is een framework dat gebruikt om webapplicaties en SPA’s te ontwikkelen voor allerlei platformen\r\n                  van desktop tot mobile. Ik ben meerdere malen in aanraking gekomen met Angular en kies ervoor om deze te\r\n                  bundelen tot één topic. De ervaringen houden seminaries, projecten en zelfs mijn stage in.</p>\r\n                <h3>Kern</h3>\r\n                <p>In het lessenpakket van Web Expert kwam ik voor het eerst in aanraking met Angular, of beter, AngularJS.\r\n                  Hier werd al meteen getoond hoe soepel, snel en herbruikbaar het framework is. Met de overgang van AngularJS\r\n                  naar Angular is echter niet alleen de taal verandert (van JavaScript naar TypeScript), maar ook het framework\r\n                  zijn kern. Er wordt bijvoorbeeld niet meer met $scope gewerkt. De eerder vergaarde kennis moest dus hervormd\r\n                  worden om mee te kunnen nemen naar toekomstige projecten, zoals mijn stage.</p>\r\n                <p>Mijn stageopdracht bij\r\n                  <a href=\"https://spikes.be/\">Spikes</a> was een 360 view doorklikbare webapplicatie met als doel data uit verschillende systemen zoals\r\n                  Outlook en Office 365 op te halen en deze gebundeld te tonen zodat projecten, collega’s, klanten, taken\r\n                  en agenda’s duidelijk konden worden voorgesteld. Dit werd mede dankzij Angular gerealiseerd en moet ik\r\n                  eigenlijk als mijn eerste echte aanraking tellen. In de krokusvakantie kreeg ik een week de tijd om mezelf\r\n                  dit aan te leren zodat de stageopdracht vlot kon starten. Hiervoor heb ik de toen bestaande “\r\n                  <a href=\"https://v2.angular.io/docs/ts/latest/tutorial/\">Tour of Heroes</a>” tutorial gevolgd, wat alle basiselementen in het framework behandelden en dieper ging\r\n                  op de geavanceerde zaken. Ik heb deze tutorial omgezet naar een project, wat ik later ingediend heb op\r\n                  EPOS. Ik leerde hier met het framework omgaan en kreeg al snel de smaak te pakken. Zoals ik al zei toen\r\n                  ik mezelf beschreef, ben ik hierdoor een Angular enthousiast geworden.</p>\r\n                <p>Omdat ik best verder wil in het Angular framework was ik aanwezig op het Angular2 seminarie wat me\r\n                  enorm hielp om de basis een keer op te frissen en technieken of specifieke onderdelen vanuit een andere\r\n                  hoek te bekijken. Het seminarie begon eigenlijk al buiten het lokaal. Met een kennismaking, broodjes en\r\n                  de kans om te netwerken ging het event van start. Hierna behandelden we de basis en gingen we in het tweede\r\n                  deel dieper in op routing en andere nuttige zaken zoals observables en data calls.</p>\r\n                <p>Maar hier stopt het niet. Het portfolio voor I-Talent, waar we ons momenteel bevinden is volledig geschreven\r\n                  in het Angular framework. Natuurlijk heb ik geen gebruik gemaakt van data calls of databases maar alle\r\n                  onderdelen zijn wel aanwezig en de secties zijn in componenten opgesplitst. Hierdoor is de structuur volledig\r\n                  aanwezig. Het portfolio mag misschien een enkele webpagina lijken maar in realiteit bestaat dit uit verschillende\r\n                  elementen die makkelijk verplaatst of hergebruikt kunnen worden.</p>\r\n                <p>De achterliggende code voor de hoofdpagina ziet er daarom als volgt uit, wat een duidelijk voorbeeld zou\r\n                  moeten schetsen van hoe de structuur eruit ziet en hoe je secties zou kunnen hergebruiken:</p>\r\n                <img class=\"img-fluid d-block mx-auto\" src=\"assets/img/portfolio/portfolio-angular/A_PORT.png\" alt=\"\">\r\n                <p>Omdat ik gebruik gemaakt heb van Bootstrap templates die enkel HTML, CSS en JavaScript bevatten was één van\r\n                  de moeilijkheden het omvormen van deze templates naar de Angular structuur. Zo maak ik gebruik van de Angular\r\n                  CLI wat scripts en stylesheets op voorhand inlaat. Ook host ik het volledige portfolio op GitHub en bleek\r\n                  het hosten van een Angular project anders te werken dan een gewone HTML-pagina. Je kan dus wel zeggen dat\r\n                  ik ondertussen veel in aanraking gekomen ben met het Angular framework.</p>\r\n                <h3>Reflectie</h3>\r\n                <p>TODO</p>\r\n                <img class=\"img-fluid d-block mx-auto\" src=\"assets/img/portfolio/portfolio-angular/A_SEM.png\" alt=\"\">\r\n                <ul class=\"list-inline\">\r\n                  <li>Angular2 Basics: 24 Februari - 3 Maart 2017</li>\r\n                  <li>Angular2 @ PXL: 27 Juni 2017</li>\r\n                  <li>I-Talent Portfolio: 2015 - 2018</li>\r\n                </ul>\r\n                <button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">\r\n                  <i class=\"fa fa-times\"></i>\r\n                  Sluit</button>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n\r\n  <!-- Modal 3 -->\r\n  <div class=\"portfolio-modal modal fade\" id=\"portfolioModal3\" tabindex=\"-1\" role=\"dialog\" aria-hidden=\"true\">\r\n    <div class=\"modal-dialog\">\r\n      <div class=\"modal-content\">\r\n        <div class=\"close-modal\" data-dismiss=\"modal\">\r\n          <div class=\"lr\">\r\n            <div class=\"rl\"></div>\r\n          </div>\r\n        </div>\r\n        <div class=\"container\">\r\n          <div class=\"row\">\r\n            <div class=\"col-lg-8 mx-auto\">\r\n              <div class=\"modal-body\">\r\n                <!-- Project Details -->\r\n                <h2>Vlaamse Programmeer Wedstrijd</h2>\r\n                <p class=\"item-intro text-muted\">Student Engagement</p>\r\n                <img class=\"img-fluid d-block mx-auto\" src=\"assets/img/VPW.png\" alt=\"\">\r\n                <p>TODO</p>\r\n                <ul class=\"list-inline\">\r\n                  <li>VPW I: 16 Februari 2016</li>\r\n                  <li>VPW II: 24 Februari 2016</li>\r\n                  <li>VPW: 3 Maart 2016</li>\r\n                </ul>\r\n                <button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">\r\n                  <i class=\"fa fa-times\"></i>\r\n                  Sluit</button>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n\r\n  <!-- Modal 4 -->\r\n  <div class=\"portfolio-modal modal fade\" id=\"portfolioModal4\" tabindex=\"-1\" role=\"dialog\" aria-hidden=\"true\">\r\n    <div class=\"modal-dialog\">\r\n      <div class=\"modal-content\">\r\n        <div class=\"close-modal\" data-dismiss=\"modal\">\r\n          <div class=\"lr\">\r\n            <div class=\"rl\"></div>\r\n          </div>\r\n        </div>\r\n        <div class=\"container\">\r\n          <div class=\"row\">\r\n            <div class=\"col-lg-8 mx-auto\">\r\n              <div class=\"modal-body\">\r\n                <!-- Project Details -->\r\n                <h2>Projectweek</h2>\r\n                <p class=\"item-intro text-muted\">Student Engagement</p>\r\n                <img class=\"img-fluid d-block mx-auto\" src=\"assets/img/PW.png\" alt=\"\">\r\n                <p>TODO</p>\r\n                <ul class=\"list-inline\">\r\n                  <li>15 - 18 Februari 2016</li>\r\n                </ul>\r\n                <button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">\r\n                  <i class=\"fa fa-times\"></i>\r\n                  Sluit</button>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n\r\n</body>\r\n\r\n</html>"

